import React from 'react';

const Button = ({ onClick, className, type = "button", full = false, children, ...props }) => {
  return (
    <div>
      <button
        type={type} 
        onClick={onClick}
        className={`${className} ${full ? 'full' : ''}`.trim()}
        {...props}
      >
        {children}
      </button>
    </div>
  );
}

export default Button;
